// FSAE
// Get the modal
var fsaeModal = document.getElementById("fsaeModal");

// Get the button that opens the modal
var fsaeBtn = document.getElementById("fsaeBtn");

// Get the <span> element that closes the modal
var fsaeClose = document.getElementById("fsaeClose");

// When the user clicks on the button, open the modal
fsaeBtn.onclick = function() {
	fsaeModal.style.display = "block";
}

// When the user clicks on <span> (x), close the modal
fsaeClose.onclick = function() {
	fsaeModal.style.display = "none";
}


