// When the user clicks anywhere outside of the modal, close it
window.onclick = function(event) {
	if (event.target == fsaeModal) {
		fsaeModal.style.display = "none";
	}
	else if (event.target == NOMADModal) {
		NOMADModal.style.display = "none";
	}
	else if (event.target == TurbineModal) {
		TurbineModal.style.display = "none";
	}
	else if (event.target == cvtModal) {
		cvtModal.style.display = "none";
	}
	else if (event.target == chaosModal) {
		chaosModal.style.display = "none";
	}
	else if (event.target == eigenModal) {
		eigenModal.style.display = "none";
	}
	else if (event.target == eggModal) {
		eggModal.style.display = "none";
	}
	else if (event.target == piModal) {
		piModal.style.display = "none";
	}
	else if (event.target == grdnModal) {
		grdnModal.style.display = "none";
	}
	else if (event.target == smModal) {
		smModal.style.display = "none";
	}
	else if (event.target == axialModal) {
		axialModal.style.display = "none";
	}
	else if (event.target == ftusModal) {
		ftusModal.style.display = "none";
	}
	else if (event.target == resumeModal) {
		resumeModal.style.display = "none";
	}
	else if (event.target == EEModal) {
		EEModal.style.display = "none";
	}
}
